export default function Navbar() {
  const path = window.location.pathname;
  return (
    <nav className="nav">
      <a href="/" className="site-title">
        Site Name
      </a>
      <ul>
        <CustomLink href="/Schedule">Schedule/Results</CustomLink>
        <CustomLink href="/Teams">Teams</CustomLink>
        <CustomLink href="/Standings">Standings</CustomLink>
        <CustomLink href="/News">News</CustomLink>
        <CustomLink href="/Youth">Youth Info</CustomLink>
        <CustomLink href="/Offseason">Offseason Info</CustomLink>
        <CustomLink href="/History">History/Records</CustomLink>
      </ul>
    </nav>
  );
}

function CustomLink({ href, children, ...props }) {
  const path = window.location.pathname;
  return (
    <li className={path === href ? "active" : ""}>
      <a href={href} {...props}>
        {children}
      </a>
    </li>
  );
}
